import React from 'react';
import Navbar from './Navbar';
import AboutSection from './AboutSection';
const  HomePage = () => {
  return (
    
    <div>
      <h1>Pack For Camp</h1>
      <p>Welcome to our online store!</p>
      <p>Here you can find everything you need for summer camp under one roof.</p>
      <p>We offer a wide range of products, from tents and sleeping bags to cooking utensils and outdoor gear.</p>
      <p>Our mission is to provide high-quality products at affordable prices, so you can enjoy your camping trips without breaking the bank.</p>
      <p>Thank you for choosing our store!</p>
      <p>If you have any questions or need assistance, please don't hesitate to contact us.</p>
      <p>Happy camping!</p>     
      <Navbar/>
    </div>
  );
};



export default HomePage;
